import React from 'react';
import classes from "./Difference.module.css";

const Difference = () => {
    return (
        <div className = {classes.wrap}>
            <div className = {classes.textBlock}>
                <div className = {classes.title}>
                    <h2>Это упростит Вашу жизнь</h2>
                    <p>Наша компания здесь, чтобы в разы увеличить
                     возможности людей, которые зарабативают деньги заграницей</p>
                </div>
                <div className = {classes.sector}></div>

            </div>
        </div>
    );
}

export default Difference;
